type CityCardProps = {
    city: string;
}

function CityCard({city}: CityCardProps ): JSX.Element {
  return (
    <li className="locations__item item tabs__item--active">
      <a className="locations__item-link tabs__item" href="/">
        <span>{city}</span>
      </a>
    </li>
  );
}

export default CityCard;
